(4, 'failure-is-not-an-option', 'Failure is not an option', '<h2>Many say exploration is part of our destiny, but it’s actually our duty to future generations.</h2><div><br></div><div>Never in all their history have men been able truly to conceive of the world as one: a single sphere, a globe, having the qualities of a globe, a round earth in which all the directions eventually meet, in which there is no center because every point, or none, is center — an equal earth which all men occupy as equals. The airman\'s earth, if free men make it, will be truly round: a globe in practice, not in theory.</div><div>Science cuts two ways, of course; its products can be used for both good and evil. But there\'s no turning back from science. The early warnings about technological dangers also come from science.</div><div>What was most significant about the lunar voyage was not that man set foot on the Moon but that they set eye on the earth.</div><div>A Chinese tale tells of some men sent to harm a young girl who, upon seeing her beauty, become her protectors rather than her violators. That\'s how I felt seeing the Earth for the first time. I could not help but love and cherish her.</div><div>For those who have seen the Earth from space, and for the hundreds and perhaps thousands more who will, the experience most certainly changes your perspective. The things that we share in our world are far more valuable than those which divide us.</div><h2><strong>The Final Frontier</strong></h2><div>There can be no thought of finishing for ‘aiming for the stars.’ Both figuratively and literally, it is a task to occupy the generations. And no matter how much progress one makes, there is always the thrill of just beginning.</div><div>There can be no thought of finishing for ‘aiming for the stars.’ Both figuratively and literally, it is a task to occupy the generations. And no matter how much progress one makes, there is always the thrill of just beginning.</div><blockquote>The dreams of yesterday are the hopes of today and the reality of tomorrow. Science has not yet mastered prophecy. We predict too much for the next year and yet far too little for the next ten.</blockquote><div>Spaceflights cannot be stopped. This is not the work of any one man or even a group of men. It is a historical process which mankind is carrying out in accordance with the natural laws of human development.</div><h2><strong>Reaching for the Stars</strong></h2><div>As we got further and further away, it [the Earth] diminished in size. Finally it shrank to the size of a marble, the most beautiful you can imagine. That beautiful, warm, living object looked so fragile, so delicate, that if you touched it with a finger it would crumble and fall apart. Seeing this has to change a man.</div><div><span style=\"color: rgb(33, 37, 41);\"><img src=\"https://source.unsplash.com/Mn9Fa_wQH-M/800x450\" alt=\"Demo Image\"></span><em style=\"color: rgb(108, 117, 125);\">To go places and do things that have never been done before – that’s what living is all about.</em></div><div><br></div><div>Space, the final frontier. These are the voyages of the Starship Enterprise. Its five-year mission: to explore strange new worlds, to seek out new life and new civilizations, to boldly go where no man has gone before.</div><div>As I stand out here in the wonders of the unknown at Hadley, I sort of realize there’s a fundamental truth to our nature, Man must explore, and this is exploration at its greatest.</div><div>Placeholder text by&nbsp;<a href=\"http://spaceipsum.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(33, 37, 41);\">Space Ipsum</a>. Photographs by&nbsp;<a href=\"https://unsplash.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(33, 37, 41);\">Unsplash</a>.</div><div><br></div>', NULL, NULL, 1, NULL, 1, 'd7976dba-35ba-4147-9681-3637b9f5fd34', '2023-11-20 10:57:35', '2024-03-20 12:03:38')