re the hopes of today and the reality of tomorrow. Science has not yet mastered prophecy. We predict too much for the next year and yet far too little for the next ten.</blockquote><div>Spaceflights cannot be stopped. This is not the work of any one man or even a group of men. It is a historical process which mankind is carrying out in accordance with the natural laws of human development.</div><h2><strong>Reaching for the Stars</strong></h2><div>As we got further and further away, it [the Earth] diminished in size. Finally it shrank to the size of a marble, the most beautiful you can imagine. That beautiful, warm, living object looked so fragile, so delicate, that if you touched it with a finger it would crumble and fall apart. Seeing this has to change a man.</div><div><span style=\"color: rgb(33, 37, 41);\"><img src=\"https://source.unsplash.com/Mn9Fa_wQH-M/800x450\" alt=\"Demo Image\"></span><em style=\"color: rgb(108, 117, 125);\">To go places and do things that have never been done before – that’s what living is all about.</em></div><div><br></div><div>Space, the final frontier. These are the voyages of the Starship Enterprise. Its five-year mission: to explore strange new worlds, to seek out new life and new civilizations, to boldly go where no man has gone before.</div><div>As I stand out here in the wonders of the unknown at Hadley, I sort of realize there’s a fundamental truth to our nature, Man must explore, and this is exploration at its greatest.</div><div><br></div>', NULL, NULL, 1, NULL, 1, NULL, '2024-03-20 12:04:40', '2024-03-20 12:04:40');

